const Card = () => {
  return (
    <div className="container-fluid">
      <div className="col-md-3">
        <div className="col-md-3">
          <img
            src="https://images.pexels.com/photos/1640777/pexels-photo-1640777.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            alt="Image Not Found"
          />
        </div>
      </div>
    </div>
  );
};
const Products = () => {
  return (
    <>
      <Card />
      <Card />
      <Card />
      <Card />
    </>
  );
};

export default Products;
